INSERT INTO `cms_about_us` (`id`, `page_title`, `page_content`, `page_em_video_id`, `created_at`, `update_at`) VALUES
(1, 'About us', '<div class=\"we_points\">\r\n<div class=\"we_points_no\">01</div>\r\n<div class=\"we_points_info\">\r\n<p>Make the defender overplay. Having a defender trying to block you or steal the ball can be a difficult obstacle to overcome.</p>\r\n</div>\r\n</div>\r\n<div class=\"we_points\">\r\n<div class=\"we_points_no\">02</div>\r\n<div class=\"we_points_info\">\r\n<p>Set the pace. Although the defender will be trying their best to slow you down it is important that you set the pace. If you slow down or give into their defense they will have a better chance of stopping you or stealing the ball</p>\r\n</div>\r\n</div>\r\n<div class=\"we_points\">\r\n<div class=\"we_points_no\">03</div>\r\n<div class=\"we_points_info\">\r\n<p>Work with your team. Soccer is a team sport and working with your team can greatly increase your chances of scoring more goals during a match.</p>\r\n</div>\r\n</div>', '3cEdjH4TBh4', '2022-06-08 10:59:16', '2022-06-08 05:29:36');
